import React from 'react';
import Vanilla from '../images/Vanilla.png';
import Chocolate from './images/Chocolate.png';
import Red_Velvet from './images/Red_Velvet.png';
import Lemon_Zest from './images/Lemon_Zest.png';
import Cookies_and_Cream from './images/Cookies_and_Cream.png';
import Salted_Caramel from './images/Salted_Caramel.png';
import Carrot_Cake from './images/Carrot_Cake.png';
import Peanut_Butter_Chocolate from './images/Peanut_Butter_Chocolate.png';

function Home() {
  return (
    <div className="Home">
      <h1>Welcome to our Ice Cream Shop!</h1>
      <p>This website allows you to browse our selection of ice cream flavors, view detailed information about each flavor, and even create your own custom ice cream!</p>
      <img src={Vanilla} alt="Vanilla" />
      <img src={Chocolate} alt="Chocolate" />
      <img src={Red_Velvet} alt="Red Velvet" />
      <img src={Lemon_Zest} alt="Lemon Zest" />
      <img src={Cookies_and_Cream} alt="Cookies and Cream" />
      <img src={Salted_Caramel} alt="Salted Caramel" />
      <img src={Carrot_Cake} alt="Carrot Cake" />
      <img src={Peanut_Butter_Chocolate} alt="Peanut Butter Chocolate" />
    </div>
  );
}

export default Home;
